import React , {useState,useEffect} from 'react';
import { Container, Row, Col,Button } from 'reactstrap';
import dynamic from 'next/dynamic'
//import { Modal } from 'react-responsive-modal';
const DynamicComponent = dynamic(() => import('../components/Card'))
const ModalExample = dynamic(()=>import('../components/Modal'))
function Index(){
  const [open,setOpen]= useState(false)


  useEffect( () => { 
      console.log(`Current State is ${open}`)
  })
  return(
    // border bottom
    <Container fluid>
    <Row style={{borderBottom: "5px solid #FFF1EA",marginLeft:'5%',marginRight:'5%',marginTop:'2%'}}>
      <Col sm style={{fontFamily:'Komu A',fontSize:'40px',fontWeight:'bold'}}>ORANGEPICK</Col>
      <Col sm ><p style={{  paddingTop:'5%',
                            textAlign: "center",
                            font: "Bold 16px/19px Josefin Sans",
                            letterSpacing: "0px",
                            color: "#130D0D",
                            opacity: "1" }}>Discovery</p></Col>
      <Col sm>
        <Button style={{paddingTop:'3%',background:"#FE6F21",float:'right',textAlign: "center", borderRadius: "10px",padding: "0",border: "none"}}>
            <p style= {{textAlign: "center",
                        font: "Bold 16px/19px Josefin Sans",
                        color: "#130D0D",
                        opacity: "1",marginTop:'3%',paddingTop:'5%',paddingLeft:'3%',paddingRight:'3%'}}>Login/Sign Up</p>
        </Button>
        </Col>
    </Row>
    <Row style= {{justifyContent: 'center', alignItems: 'center', fontFamily:'Span' }} >
        <p style = {{fontFamily:'Span',fontSize:'34px',fontWeight:'lighter',marginTop:'2%'}}> Launched on OrangePick today </p>
    </Row>
    <div onClick={()=> setOpen(true)}>
    <DynamicComponent onClick= {()=> setOpen(true)}></DynamicComponent>
    </div>

    <Modal size="xl" open={open} onClose={()=> setOpen(false)} center classNames={{
        overlay: 'customOverlay',
          modal: 'customModal',
        }} >
      <p>
      Mauris ac arcu sit amet dui interdum bibendum a sed diam. Praesent
      rhoncus congue ipsum elementum lobortis. Ut ligula purus, ultrices id
      condimentum quis, tincidunt quis purus. Proin quis enim metus. Nunc
      feugiat odio at eros porta, ut rhoncus lorem tristique. Nunc et ipsum eu
      ex vulputate consectetur vel eu nisi. Donec ultricies rutrum lectus, sit
      ame feugiat est semper vitae. Proin varius imperdiet consequat. Proin eu
      metus nisi. In hac habitasse platea dictumst. Vestibulum ac ultrices
      risus. Pellentesque arcu sapien, aliquet sed orci sit amet, pulvinar
      interdum velit. Nunc a rhoncus ipsum, maximus fermentum dolor. Praesent
      aliquet justo vitae rutrum volutpat. Ut quis pulvinar est.
    </p>
      </Modal>
    </Container>
    //before container row then the card
  );
}
export default Index
